import React from "react";

function SetMinus (props) {
  return (
    <div className="page__status">
      <div className="page__status__header">
        Здравствуйте, Человек №58745874
        <a type="button" onClick={props.onClick}>Сменить статус</a>
      </div>
      <WriteStatus status={props.status}/>
    </div>
  )
}

function WriteStatus (props) {
  return (
    <div>
      {props.status}
    </div>
  )
}

export default SetMinus
